import styled from "styled-components";
import { Link } from "react-router-dom";

export default function HomeMain() {
  return (
    <HomeContainer>
      <div className="curve"></div>
      <h1>Henry Countries</h1>
      <Intro>
        ¿Estas listo para conocer un poco sobre los paises de tu interés? Entra
        a la siguiente sección y disfruta del contenido.
      </Intro>
      <Link to="/countries">
        Explorar
      </Link>
    </HomeContainer>
  );
}

const HomeContainer = styled.main`
  display: flex;
  flex-direction: column;
  justify-content: space-around;
  align-content: space-around;
  align-items: center;
  height: 30rem;
  background-color: aliceblue;

  .curve{
    position: absolute;
    height: 22rem;
    width: 100%;
    bottom: 0;
    &::before{
      content: "";
      display: block;
      position: absolute;
      border-radius: 100% 50%;
      width: 55%;
      height: 100%;
      background-color: #212121;
      transform: translate(85%, 60%);
    }
    &::after{
      content: "";
      display: block;
      position: absolute;
      border-radius: 100% 50%;
      width: 55%;
      height: 100%;
      background-color: #1a247a;
      transform: translate(2%, 40%);
    }
  }
`;

const Intro = styled.section`
  background-color: cadetblue;
  text-align: center;
`;
